import React, { Fragment } from 'react';
import { Link } from 'react-router-dom';



const MailActivation = () => {

  return (
    <Fragment>
      <h1 className='large text-primary'>You have been succesfuly activated. You can login now!{' '}</h1>
      <p className='lead'>
      <Link to="/login">
          <a>
            Login
          </a>
        </Link>
      </p>
    </Fragment>
  );
};

export default MailActivation;
